import React, { Fragment } from "react";

/* Components */
import { MatriculaForm } from "./components/form-banner/form";
import { FadeSlider } from "./components/form-banner/fadeSlider";
import { EducationOffered } from "./components/Education_Offered";

/* Styles */
import './matricula.scss'

export function Matricula() {
  return (
    <Fragment>
      <main className="matricula">
        <section className="matricula-s1">
          <div className="container">
            <FadeSlider />
            <MatriculaForm />
          </div>
          <article className="offeredEducation">
            <EducationOffered />
          </article>
          <article className="morePropEdu"></article>
          <article className="moreAbout"></article>
        </section>
      </main>
    </Fragment>
  );
}
